CSPP.js.keyStrokeInfo:
import React, {useState, useEffect } from 'react'
import Axios from 'axios';
import itw from './itw.png'


function Itw() {
    const [itwList, setItwList] = useState([])

    useEffect(()=>{
        Axios.get("http://localhost:3001/itw").then((response)=>{
            setItwList(response.data)
        })
      }, [])


    return (
        <div className="row">
            {itwList.map((val)=>{
                return (
                    <div className="col-12 col-sm-4">                        
                        <div className="card">
                            <img className="card-img-top" src={itw} alt="Card image cap" />
                            <div className="card-body">
                                <p className="card-text">{val.Description}</p>
                                <a href={val.Videourl} class="btn btn-primary">Watch</a>
                            </div>
                        </div>
                    </div>
                    )
                })}
        </div>
    )
}

export default Itw

